import {
  Container,Row,Col//,UncontrolledDropdown,DropdownItem,DropdownMenu,DropdownToggle
} from 'reactstrap';
import Example from './Example';
const Layout = () => {
    return (
          <Row>
            <Col xs="2"><Example /></Col>
            <Col xs="auto">Main </Col>
          </Row>
      );
};
  
export default Layout;
